import Banner from "../layout/Banner"
import Infographic from "../layout/Infographic"
import FlightSpecials from "../layout/FlightSpecials"
import HotelSpecials from "../layout/HotelSpecials"
import bannerpalmtrees from "../img/bannerpalmtrees.jpg"
import HotelSearchComponent from "../layout/HotelSearchComponent"
const HotelPage = () => {
  return (
    <Fragment> 
    <div className="home">

    <Banner imageurl={"url(https://images.unsplash.com/photo-1519446251021-1c4ee77fec1e?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=1213&q=80)"} backgroundPos ={"right down"}/>

   <HotelSearchComponent/> 
    </div>

    </Fragment>
  );
};

export default HotelPage;
